import uniqid from 'uniqid'
const ProjectItems = [
    {id: uniqid(), name: 'Fresh Out', info: "Ruby | Javascript | Heroku | HTML/CSS", img: require('./images/phone-screen-template.jpg')},
    {id: uniqid(), name: 'Japan Landmark', info: "Ruby | Javascript | Heroku | HTML/CSS",img: require('./images/Landmark_Home_Small.jpg')},
    {id: uniqid(), name: 'Memory Card', img: require('./images/Memory_Game.jpg')},
    // {id: uniqid(), name: 'Farm', img: require('./images/Fresh_Out_Title.jpg')},
]

export default ProjectItems;
